INSERT INTO `hab_app_habit_template`(`id`, `title`, `icon_url`, `icon_color`, `description`, `type`, `stick_days`, `daily_count`, `each_time`, `class1`, `class2`, `remind`, `freq_type`, `freq_days`, `counter`, `timer`, `temp_order`, `used_count`, `creator`, `gmt_create`, `modifier`, `gmt_modified`, `is_deleted`) VALUES (3, '午休', NULL, NULL, '午睡可以有效刺激体内淋巴细胞,增强免疫细胞活跃性,让孩子的抵抗力越来越好,对于处于生长发育的孩子来说,睡午觉自然就更利于他长高,长壮。午睡缓解孩子一上午的疲劳,下午才能精力充沛,心情愉快。', 'TIME', 21, 1, 7200, 1, 11, '[{\"body\":\"\",\"hour\":12,\"id\":0,\"label\":\"12时\",\"minute\":0,\"second\":0,\"status\":true,\"title\":\"\"}]', 'F1', '1,2,3,4,5,6,7', NULL, '2小时', NULL, NULL, 'system', '2019-12-20 03:04:23', 'system', '2019-12-20 03:04:23', 'n');
INSERT INTO `hab_app_habit_template`(`id`, `title`, `icon_url`, `icon_color`, `description`, `type`, `stick_days`, `daily_count`, `each_time`, `class1`, `class2`, `remind`, `freq_type`, `freq_days`, `counter`, `timer`, `temp_order`, `used_count`, `creator`, `gmt_create`, `modifier`, `gmt_modified`, `is_deleted`) VALUES (4, '独立进餐,不挑食', NULL, NULL, '鼓励孩子独立进餐。孩子从小开始教育给他正确的饮食,什么能吃？什么不能吃？告诫孩子学会控制自己的饮食欲望,建立良好的饮食习惯,有利于孩子拥有健康的身体和体质,提高对疾病的抵御力。明确地告诉孩子,这顿不吃好,过了时间就没得吃,直至下一顿才能吃,这期间除了可以喝水外,零食是绝对不能吃的,无论孩子说自己有多饿,以此强迫他形成良好的进食习惯,绝对不能养成宝宝边吃边玩的坏习惯。', 'COUNT', 21, 1, NULL, 1, 12, '[{\"body\":\"\",\"hour\":20,\"id\":0,\"label\":\"20时\",\"minute\":0,\"second\":0,\"status\":true,\"title\":\"\"}]', 'F1', '1,2,3,4,5,6,7', NULL, NULL, NULL, NULL, 'system', '2019-12-20 03:04:23', 'system', '2019-12-20 03:04:23', 'n');
