INSERT INTO `hab_app_habit_template`(`id`, `title`, `icon_url`, `icon_color`, `description`, `type`, `stick_days`, `daily_count`, `each_time`, `class1`, `class2`, `remind`, `freq_type`, `freq_days`, `counter`, `timer`, `temp_order`, `used_count`, `creator`, `gmt_create`, `modifier`, `gmt_modified`, `is_deleted`) VALUES (52, '暑假作业', NULL, NULL, '暑假,虽说是给孩子放松玩乐的时期,但也同时是让孩子进步发展的关键时期。暑假过后,每个年级的孩子都要升入新的年级了。要敢于放手让孩子自主地规划自己想要渡过的暑期,并学会科学有效地管理和分配自己的假期时间。建议每天保持两个小时左右地时间在学习状态就可以了。孩子在假期当中一定要做到劳逸结合。', 'TIME', 21, 1, 3600, 2, 32, NULL, 'F1', '1,2,3,4,5', NULL, '1小时', NULL, NULL, 'system', '2019-12-20 03:04:25', 'system', '2019-12-20 03:04:25', 'n');
