INSERT INTO `hab_app_habit_template`(`id`, `title`, `icon_url`, `icon_color`, `description`, `type`, `stick_days`, `daily_count`, `each_time`, `class1`, `class2`, `remind`, `freq_type`, `freq_days`, `counter`, `timer`, `temp_order`, `used_count`, `creator`, `gmt_create`, `modifier`, `gmt_modified`, `is_deleted`) VALUES (72, '绘本阅读亲子', NULL, NULL, '长期坚持亲子阅读,让孩子与家庭的联系更加紧密；亲子阅读的多样化让儿童阅读兴趣得到充分的刺激并促进阅读习惯的养成。拿着绘本,富有感情地一字一句朗读给孩子听。也可让孩子一边看图一边听。阅读从封面开始:可以让孩子猜猜看,书的内容是什么,也可以一字一字地读出书名,让孩子明白字的读法是一字一音的,孩子慢慢地就会认得一些常用字,但不要强迫学习认字,而应期望借着多采多姿的故事,让孩子感受阅读的美好。', 'TIME', 100, 1, 600, 3, 36, '[{\"body\":\"\",\"hour\":20,\"id\":0,\"label\":\"20时\",\"minute\":0,\"second\":0,\"status\":true,\"title\":\"\"}]', 'F1', '1,2,3,4,5,6,7', NULL, '10分钟', NULL, NULL, 'system', '2019-12-20 03:04:25', 'system', '2019-12-20 03:04:25', 'n');
INSERT INTO `hab_app_habit_template`(`id`, `title`, `icon_url`, `icon_color`, `description`, `type`, `stick_days`, `daily_count`, `each_time`, `class1`, `class2`, `remind`, `freq_type`, `freq_days`, `counter`, `timer`, `temp_order`, `used_count`, `creator`, `gmt_create`, `modifier`, `gmt_modified`, `is_deleted`) VALUES (73, '看图说话', NULL, NULL, '看图说话不仅可以培养孩子主动表达能力,还可以丰富词汇量,能学习到简单的组词和说短句,更重要的是能逐渐让孩子用连贯的句子来表达个人对图的理解。看图说话可以为以后小低语文的看图写话打下良好的基础,是培养,提高儿童认识能力,形象思维能力和表达能力的良好途径。', 'COUNT', 7, 1, NULL, 3, 40, '[{\"body\":\"\",\"hour\":20,\"id\":0,\"label\":\"20时\",\"minute\":0,\"second\":0,\"status\":true,\"title\":\"\"}]', 'F7', '3', NULL, NULL, NULL, NULL, 'system', '2019-12-20 03:04:25', 'system', '2019-12-20 03:04:25', 'n');
