INSERT INTO `hab_app_habit_template`(`id`, `title`, `icon_url`, `icon_color`, `description`, `type`, `stick_days`, `daily_count`, `each_time`, `class1`, `class2`, `remind`, `freq_type`, `freq_days`, `counter`, `timer`, `temp_order`, `used_count`, `creator`, `gmt_create`, `modifier`, `gmt_modified`, `is_deleted`) VALUES (106, '触觉训练', NULL, NULL, '作用:强化皮肤,大小肌肉关节神经感应,辨识感觉层次,调整大脑感觉神经的灵敏度。训练器材有:按摩球,平衡触觉板。适应儿童:爱哭,胆小,情绪化,怕陌生,怕人触碰,发音不准确,偏食,挑食,注意力差,特别粘人或容易紧张,退缩,不敢表现自己,体弱多病等。', 'TIME', 21, 1, 600, 4, 69, '[{\"body\":\"\",\"hour\":20,\"id\":0,\"label\":\"20时\",\"minute\":0,\"second\":0,\"status\":true,\"title\":\"\"}]', 'F7', '3', NULL, '10分钟', NULL, NULL, 'system', '2019-12-20 03:04:26', 'system', '2019-12-20 03:04:26', 'n');
INSERT INTO `hab_app_habit_template`(`id`, `title`, `icon_url`, `icon_color`, `description`, `type`, `stick_days`, `daily_count`, `each_time`, `class1`, `class2`, `remind`, `freq_type`, `freq_days`, `counter`, `timer`, `temp_order`, `used_count`, `creator`, `gmt_create`, `modifier`, `gmt_modified`, `is_deleted`) VALUES (107, '前庭平衡觉训练', NULL, NULL, '作用:调整前庭信息及平衡神经系统自动反应能,促进语言组织神经健全,前庭平衡及试听能力完整程度。\n训练器材:圆筒,按摩大球,平衡木,袋鼠袋,平衡滑车\n适应儿童:身体灵活度不足,姿势不正,双侧协调不佳,多动,爱惹人,语言发展迟缓,视觉空间不佳。阅读困难,自信心不足,注意力不集中,容易跌倒,方向感不明,学习能力以及习惯培养不起来。', 'TIME', 21, 1, 600, 4, 69, '[{\"body\":\"\",\"hour\":20,\"id\":0,\"label\":\"20时\",\"minute\":0,\"second\":0,\"status\":true,\"title\":\"\"}]', 'F7', '3', NULL, '10分钟', NULL, NULL, 'system', '2019-12-20 03:04:26', 'system', '2019-12-20 03:04:26', 'n');
INSERT INTO `hab_app_habit_template`(`id`, `title`, `icon_url`, `icon_color`, `description`, `type`, `stick_days`, `daily_count`, `each_time`, `class1`, `class2`, `remind`, `freq_type`, `freq_days`, `counter`, `timer`, `temp_order`, `used_count`, `creator`, `gmt_create`, `modifier`, `gmt_modified`, `is_deleted`) VALUES (108, '弹跳训练', NULL, NULL, '作用:调整固有平衡。前庭平衡感觉神经系统,强化触觉神经,关节信息,促进左右脑健全发展。\n训练器材:羊角球,跳床\n适应儿童:站坐无相,姿势不正,情绪化,身体灵活度不够。多动,注意力不集中,语言发展迟缓,阅读困难,胆小。情绪化,笨手笨脚,视觉判断不良,触觉发展不佳,关节信息失调。', 'TIME', 21, 1, 600, 4, 69, '[{\"body\":\"\",\"hour\":20,\"id\":0,\"label\":\"20时\",\"minute\":0,\"second\":0,\"status\":true,\"title\":\"\"}]', 'F7', '3', NULL, '10分钟', NULL, NULL, 'system', '2019-12-20 03:04:26', 'system', '2019-12-20 03:04:26', 'n');
INSERT INTO `hab_app_habit_template`(`id`, `title`, `icon_url`, `icon_color`, `description`, `type`, `stick_days`, `daily_count`, `each_time`, `class1`, `class2`, `remind`, `freq_type`, `freq_days`, `counter`, `timer`, `temp_order`, `used_count`, `creator`, `gmt_create`, `modifier`, `gmt_modified`, `is_deleted`) VALUES (109, '固有平衡训练', NULL, NULL, '作用:调整脊髓中枢神经核对地心吸力的协调,强化中耳平衡体系,协调全身神经机能,奠定大脑发展基础。\n训练器材:独脚椅,大陀螺,脚步器,竖抱筒。\n适应儿童:多动不安,容易跌倒,脾气急躁,好惹人,语言发展不佳,缺乏组织能力及推理能力,双侧协调不良,手脚不灵活,自信心不足。', 'TIME', 21, 1, 600, 4, 69, '[{\"body\":\"\",\"hour\":20,\"id\":0,\"label\":\"20时\",\"minute\":0,\"second\":0,\"status\":true,\"title\":\"\"}]', 'F7', '3', NULL, '10分钟', NULL, NULL, 'system', '2019-12-20 03:04:26', 'system', '2019-12-20 03:04:26', 'n');
INSERT INTO `hab_app_habit_template`(`id`, `title`, `icon_url`, `icon_color`, `description`, `type`, `stick_days`, `daily_count`, `each_time`, `class1`, `class2`, `remind`, `freq_type`, `freq_days`, `counter`, `timer`, `temp_order`, `used_count`, `creator`, `gmt_create`, `modifier`, `gmt_modified`, `is_deleted`) VALUES (110, '本体感训练', NULL, NULL, '作用:强化固有平衡,触觉,大小肌肉双调,提升身体运动能力,健全左右脑均衡发展,调整固有平衡。\n训练器材:跳床,平衡木,晃动独木桥,滑板,S型垂直平衡木,S型水平平衡木,圆形平衡板。\n适应儿童:精细动作不良,多动不安,语言发育缓慢,注意力不集中,组织力及创造力不佳。', 'TIME', 21, 1, 600, 4, 69, '[{\"body\":\"\",\"hour\":20,\"id\":0,\"label\":\"20时\",\"minute\":0,\"second\":0,\"status\":true,\"title\":\"\"}]', 'F7', '3', NULL, '10分钟', NULL, NULL, 'system', '2019-12-20 03:04:26', 'system', '2019-12-20 03:04:26', 'n');
INSERT INTO `hab_app_habit_template`(`id`, `title`, `icon_url`, `icon_color`, `description`, `type`, `stick_days`, `daily_count`, `each_time`, `class1`, `class2`, `remind`, `freq_type`, `freq_days`, `counter`, `timer`, `temp_order`, `used_count`, `creator`, `gmt_create`, `modifier`, `gmt_modified`, `is_deleted`) VALUES (111, '视觉感训练', NULL, NULL, '作用:对看到的物体做出正确的识别与识记,并配合语音功能产生正确的信息整合与输出。适应儿童:看书时容易漏字,掉字,写字串行,偏旁部首容易写错,不会做计算,学了就忘,抄错题,甚至不认识字。抄写板书慢,视觉记忆,视觉辨别,视觉广度欠佳', 'TIME', 21, 1, 600, 4, 69, '[{\"body\":\"\",\"hour\":20,\"id\":0,\"label\":\"20时\",\"minute\":0,\"second\":0,\"status\":true,\"title\":\"\"}]', 'F7', '3', NULL, '10分钟', NULL, NULL, 'system', '2019-12-20 03:04:26', 'system', '2019-12-20 03:04:26', 'n');
INSERT INTO `hab_app_habit_template`(`id`, `title`, `icon_url`, `icon_color`, `description`, `type`, `stick_days`, `daily_count`, `each_time`, `class1`, `class2`, `remind`, `freq_type`, `freq_days`, `counter`, `timer`, `temp_order`, `used_count`, `creator`, `gmt_create`, `modifier`, `gmt_modified`, `is_deleted`) VALUES (112, '听觉感训练', NULL, NULL, '作用:对听到的信息进行加工处理,做出准确的判断与反应过程。适应儿童:对别人说的话听而不见,丢三落四,经常忘记老师布置的作业。音律不准,读英文音辩不佳,随听随忘。', 'TIME', 21, 1, 600, 4, 69, '[{\"body\":\"\",\"hour\":20,\"id\":0,\"label\":\"20时\",\"minute\":0,\"second\":0,\"status\":true,\"title\":\"\"}]', 'F7', '3', NULL, '10分钟', NULL, NULL, 'system', '2019-12-20 03:04:26', 'system', '2019-12-20 03:04:26', 'n');
INSERT INTO `hab_app_habit_template`(`id`, `title`, `icon_url`, `icon_color`, `description`, `type`, `stick_days`, `daily_count`, `each_time`, `class1`, `class2`, `remind`, `freq_type`, `freq_days`, `counter`, `timer`, `temp_order`, `used_count`, `creator`, `gmt_create`, `modifier`, `gmt_modified`, `is_deleted`) VALUES (113, '早晚刷牙', NULL, NULL, '将牙刷的刷毛与牙齿表面成45度,斜放并轻压在牙齿和牙龈的交界处,轻轻做小圆弧状来回刷（就是来回画圆）,上牙从上往下刷,下牙从下往上刷,注意轻刷牙龈,适当按摩可促进其血液循环。将牙刷平放在牙齿上,力度适中来回刷牙齿咬合面,仔细地把咀嚼面的牙缝清理干净。竖起牙刷,用牙刷前端的刷毛,轻柔地上下刷牙齿内表面,将牙缝清理干净。最后别忘了把舌头也刷一刷,从舌根向舌尖轻柔地刷,去除舌苔,消除细菌,保持口气清新。', 'COUNT', 21, 2, NULL, 5, 76, '[{\"body\":\"\",\"hour\":20,\"id\":0,\"label\":\"20时\",\"minute\":0,\"second\":0,\"status\":true,\"title\":\"\"}]', 'F1', '1,2,3,4,5,6,7', NULL, NULL, NULL, NULL, 'system', '2019-12-20 03:04:26', 'system', '2019-12-20 03:04:26', 'n');
