INSERT INTO `hab_app_habit_template`(`id`, `title`, `icon_url`, `icon_color`, `description`, `type`, `stick_days`, `daily_count`, `each_time`, `class1`, `class2`, `remind`, `freq_type`, `freq_days`, `counter`, `timer`, `temp_order`, `used_count`, `creator`, `gmt_create`, `modifier`, `gmt_modified`, `is_deleted`) VALUES (131, '折纸', NULL, NULL, '折纸让孩子学会思考,提高动手能力以及眼脑手的协调能力。可以辅助孩子的学习,把抽象的数字,几何图形等,变成形象的折纸。有利于培养孩子有序地认真做事的好习惯。培养观察力和专注力等。折纸的可塑性极强,可以说是千变万化,通过折纸可以发展孩子的创造力,想象力和形象思维能力等。优秀的折纸作品,造型优美生动。折叠过程中,孩子能潜移默化地感受到美的教育,提升孩子的审美能力。', 'TIME', 21, 1, 900, 6, 91, NULL, 'F7', '3', NULL, '15分钟', NULL, NULL, 'system', '2019-12-20 03:04:26', 'system', '2019-12-20 03:04:26', 'n');
