INSERT INTO `hab_app_habit_template`(`id`, `title`, `icon_url`, `icon_color`, `description`, `type`, `stick_days`, `daily_count`, `each_time`, `class1`, `class2`, `remind`, `freq_type`, `freq_days`, `counter`, `timer`, `temp_order`, `used_count`, `creator`, `gmt_create`, `modifier`, `gmt_modified`, `is_deleted`) VALUES (190, '结识新朋友', NULL, NULL, NULL, 'COUNT', 21, 1, NULL, 9, 112, NULL, 'F1', '1,2,3,4,5,6,7', NULL, NULL, NULL, NULL, 'system', '2019-12-20 03:04:28', 'system', '2019-12-20 03:04:28', 'n');
INSERT INTO `hab_app_habit_template`(`id`, `title`, `icon_url`, `icon_color`, `description`, `type`, `stick_days`, `daily_count`, `each_time`, `class1`, `class2`, `remind`, `freq_type`, `freq_days`, `counter`, `timer`, `temp_order`, `used_count`, `creator`, `gmt_create`, `modifier`, `gmt_modified`, `is_deleted`) VALUES (191, '对孩子说一句鼓励的话', NULL, NULL, '自信是走向成功的桥梁,经常受到鼓励的孩子,自信心会比没有受到鼓励的孩子高。', 'COUNT', 21, 1, NULL, 10, 127, NULL, 'F1', '1,2,3,4,5,6,7', NULL, NULL, NULL, NULL, 'system', '2019-12-20 03:04:28', 'system', '2019-12-20 03:04:28', 'n');
INSERT INTO `hab_app_habit_template`(`id`, `title`, `icon_url`, `icon_color`, `description`, `type`, `stick_days`, `daily_count`, `each_time`, `class1`, `class2`, `remind`, `freq_type`, `freq_days`, `counter`, `timer`, `temp_order`, `used_count`, `creator`, `gmt_create`, `modifier`, `gmt_modified`, `is_deleted`) VALUES (192, '感谢孩子一件事', NULL, NULL, NULL, 'COUNT', 21, 1, NULL, 10, 127, NULL, 'F1', '1,2,3,4,5,6,7', NULL, NULL, NULL, NULL, 'system', '2019-12-20 03:04:28', 'system', '2019-12-20 03:04:28', 'n');
INSERT INTO `hab_app_habit_template`(`id`, `title`, `icon_url`, `icon_color`, `description`, `type`, `stick_days`, `daily_count`, `each_time`, `class1`, `class2`, `remind`, `freq_type`, `freq_days`, `counter`, `timer`, `temp_order`, `used_count`, `creator`, `gmt_create`, `modifier`, `gmt_modified`, `is_deleted`) VALUES (193, '随时表扬', NULL, NULL, '随时表扬,要做到不怕重复,逢人便夸。\n比如家里有客人来,你可以展示一些孩子平日的规划,作业成果,兴趣作品等等,然后当着孩子的面表扬他的努力和进步；再比如在小区和邻居聊天,可以和他们分享孩子最近做的让你自豪的事。\n这样的表扬不怕重复,哪怕听到孩子不耐烦地嘟囔“好了好了,别老提这些了”也不要停。', 'COUNT', 21, 1, NULL, 10, 127, NULL, 'F1', '1,2,3,4,5,6,7', NULL, NULL, NULL, NULL, 'system', '2019-12-20 03:04:28', 'system', '2019-12-20 03:04:28', 'n');
INSERT INTO `hab_app_habit_template`(`id`, `title`, `icon_url`, `icon_color`, `description`, `type`, `stick_days`, `daily_count`, `each_time`, `class1`, `class2`, `remind`, `freq_type`, `freq_days`, `counter`, `timer`, `temp_order`, `used_count`, `creator`, `gmt_create`, `modifier`, `gmt_modified`, `is_deleted`) VALUES (194, '家庭周会', NULL, NULL, '开家庭会议主要是为了沟通意见,培养家庭成员计划与决策的能力,解决冲突,分担家事还有学习社会互动的经验。家庭会议应该每周一次,决定应该在全体一致同意的基础上做出。可以和孩子一起就一些常见问题预先讨论解决方案。家庭会议结束前的最后一项,应该用来计划下周的家庭娱乐活动。家庭会议应该以一个全家人参与的活动来结束。', 'COUNT', 21, 1, NULL, 10, 127, NULL, 'F1', '6', NULL, NULL, NULL, NULL, 'system', '2019-12-20 03:04:28', 'system', '2019-12-20 03:04:28', 'n');
